import React from 'react';
import SectionHeader from './SectionHeader';
import { Container, Col, Row, Card, CardColumns } from 'react-bootstrap';
import scissors from '../pictures/scissors3.png';
import razor from '../pictures/razor3.png';
import both from '../pictures/both.png';
import styled from 'styled-components';
import { breakpoints } from 'styled-bootstrap-responsive-breakpoints';

const Styles = styled.div`

.card {
  justify-content
  img {
    width: 20em;
    margin: auto;
  }
}

#services {
  position: relative;
}

#content {
  position: absolute;
  z-index: 2;
  width: 100%;
  
  
}

#opacity {
  background: #222831;
  position: absolute;
  z-index: 1;
  width: 100%;
  height: 100%;
  opacity: 1; 
}

.bg {
  //background: violet;
  border: 2px solid red;
  width: 70vw;
  margin: auto;
  
}

`

function Services() {
  return (
    <Styles id="services">
      <div id="opacity"></div>
      <div id="content">
        <SectionHeader name="Services" />
        <div className="bg">

          <CardColumns>
            <Card text="white" className="p-3">
              <Card.Img variant="top" src={scissors} />
              <Card.Body>
                <Card.Title>Card title that wraps to a new line</Card.Title>
                <Card.Text>
                  This is a longer card with supporting text below as a natural lead-in to
                  additional content. This content is a little bit longer.
                </Card.Text>
              </Card.Body>
            </Card>
            <Card className="p-3">
              <Card.Img variant="top" src={razor} />
              <Card.Body>
                <Card.Title>Card title that wraps to a new line</Card.Title>
                <Card.Text>
                  This is a longer card with supporting text below as a natural lead-in to
                  additional content. This content is a little bit longer.
                </Card.Text>
              </Card.Body>
            </Card>
            <Card className="p-3">
              <Card.Img variant="top" src={both} />
              <Card.Body>
                <Card.Title>Card title that wraps to a new line</Card.Title>
                <Card.Text>
                  This is a longer card with supporting text below as a natural lead-in to
                  additional content. This content is a little bit longer.
                </Card.Text>
              </Card.Body>
            </Card>
          </CardColumns>

        </div>
      </div>
    </Styles>
  );



}

export default Services;
